import React from 'react'
import UrlCard from '../../card/UrlCard'

function Videos(props) {
    return (
        <div className="LibCards">
            <div className="Cards">
                {   props.library.title ?
                    props.library.map(data => {
                        return(
                        <p>{data.title}</p>
                        );
                    }) : <div></div>
                }
            </div>
        </div>
    )
}

export default Videos
